import React, { useEffect, useState } from 'react';
import { Card, CardContent, CardHeader, CardTitle } from '../components/ui/card';
import { Badge } from '../components/ui/badge';
import {
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableHeader,
  TableRow,
} from '../components/ui/table';
import {
  Cpu,
  HardDrive,
  Activity,
  Zap,
  Clock
} from 'lucide-react';
import { SystemMetrics, RequestLog, EngineStatus } from '../types';

const Monitoring: React.FC = () => {
  const [metrics, setMetrics] = useState<SystemMetrics[]>([]);
  const [logs, setLogs] = useState<RequestLog[]>([]);
  const [engineStatus, setEngineStatus] = useState<EngineStatus>({
    state: 'stopped',
    request_count: 0,
    error_count: 0,
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchData();

    // Set up polling
    const interval = setInterval(fetchData, 5000);
    return () => clearInterval(interval);
  }, []);

  const fetchData = async () => {
    try {
      const [metricsRes, logsRes, engineRes] = await Promise.all([
        fetch('/api/monitoring/metrics'),
        fetch('/api/monitoring/logs?limit=50'),
        fetch('/api/monitoring/engine')
      ]);

      const [metricsData, logsData, engineData] = await Promise.all([
        metricsRes.json(),
        logsRes.json(),
        engineRes.json()
      ]);

      setMetrics(metricsData);
      setLogs(logsData);
      setEngineStatus(engineData);
    } catch (error) {
      console.error('Failed to fetch monitoring data:', error);
    } finally {
      setLoading(false);
    }
  };

  const getStatusBadgeVariant = (state: string) => {
    switch (state) {
      case 'running':
        return 'default';
      case 'stopped':
        return 'secondary';
      case 'starting':
        return 'outline';
      case 'error':
        return 'destructive';
      default:
        return 'secondary';
    }
  };

  const formatTimestamp = (timestamp: string) => {
    return new Date(timestamp).toLocaleString();
  };

  const currentMetrics = metrics[metrics.length - 1];

  if (loading) {
    return <div className="text-center py-8">Loading monitoring data...</div>;
  }

  return (
    <div className="space-y-6">
      <h1 className="text-3xl font-bold text-gray-900">System Monitoring</h1>

      {/* Engine Status */}
      <Card>
        <CardHeader>
          <CardTitle className="flex items-center">
            <Activity className="h-5 w-5 mr-2" />
            Engine Status
          </CardTitle>
        </CardHeader>
        <CardContent>
          <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
            <div className="text-center">
              <div className="text-2xl font-bold mb-2">
                <Badge variant={getStatusBadgeVariant(engineStatus.state)} className="text-lg px-3 py-1">
                  {engineStatus.state.toUpperCase()}
                </Badge>
              </div>
              <div className="text-sm text-gray-600">Status</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-bold mb-2">{engineStatus.request_count}</div>
              <div className="text-sm text-gray-600">Total Requests</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-bold mb-2 text-red-600">{engineStatus.error_count}</div>
              <div className="text-sm text-gray-600">Errors</div>
            </div>
            <div className="text-center">
              <div className="text-2xl font-bold mb-2">
                {engineStatus.throughput ? `${engineStatus.throughput.toFixed(1)} req/s` : 'N/A'}
              </div>
              <div className="text-sm text-gray-600">Throughput</div>
            </div>
          </div>
        </CardContent>
      </Card>

      {/* System Metrics */}
      {currentMetrics && (
        <Card>
          <CardHeader>
            <CardTitle className="flex items-center">
              <Cpu className="h-5 w-5 mr-2" />
              System Metrics
            </CardTitle>
          </CardHeader>
          <CardContent>
            <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">{currentMetrics.cpu_usage.toFixed(1)}%</div>
                <div className="text-sm text-gray-600">CPU Usage</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">
                  {(currentMetrics.memory_usage / 1024 / 1024 / 1024).toFixed(1)}GB
                </div>
                <div className="text-sm text-gray-600">Memory Usage</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">{currentMetrics.disk_usage.toFixed(1)}%</div>
                <div className="text-sm text-gray-600">Disk Usage</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">
                  <Clock className="h-5 w-5 mx-auto mb-1" />
                </div>
                <div className="text-sm text-gray-600">Last Update</div>
              </div>
            </div>
          </CardContent>
        </Card>
      )}

      {/* Network Stats */}
      {currentMetrics && (
        <Card>
          <CardHeader>
            <CardTitle className="flex items-center">
              <HardDrive className="h-5 w-5 mr-2" />
              Network Statistics
            </CardTitle>
          </CardHeader>
          <CardContent>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">
                  {(currentMetrics.network_rx / 1024 / 1024).toFixed(1)} MB
                </div>
                <div className="text-sm text-gray-600">Received</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold mb-2">
                  {(currentMetrics.network_tx / 1024 / 1024).toFixed(1)} MB
                </div>
                <div className="text-sm text-gray-600">Transmitted</div>
              </div>
            </div>
          </CardContent>
        </Card>
      )}

      {/* Request Logs */}
      <Card>
        <CardHeader>
          <CardTitle className="flex items-center">
            <Zap className="h-5 w-5 mr-2" />
            Recent Request Logs
          </CardTitle>
        </CardHeader>
        <CardContent>
          <Table>
            <TableHeader>
              <TableRow>
                <TableHead>Time</TableHead>
                <TableHead>Method</TableHead>
                <TableHead>URL</TableHead>
                <TableHead>Status</TableHead>
                <TableHead>Response Time</TableHead>
                <TableHead>Client IP</TableHead>
              </TableRow>
            </TableHeader>
            <TableBody>
              {logs.map((log) => (
                <TableRow key={log.id}>
                  <TableCell className="font-mono text-sm">
                    {formatTimestamp(log.timestamp)}
                  </TableCell>
                  <TableCell>
                    <Badge variant="outline" className="font-mono">
                      {log.method}
                    </Badge>
                  </TableCell>
                  <TableCell className="font-mono text-sm max-w-xs truncate">
                    {log.url}
                  </TableCell>
                  <TableCell>
                    <Badge variant={log.status_code >= 400 ? 'destructive' : 'default'}>
                      {log.status_code}
                    </Badge>
                  </TableCell>
                  <TableCell>{log.response_time}ms</TableCell>
                  <TableCell className="font-mono text-sm">{log.client_ip}</TableCell>
                </TableRow>
              ))}
              {logs.length === 0 && (
                <TableRow>
                  <TableCell colSpan={6} className="text-center py-8 text-gray-500">
                    No request logs available
                  </TableCell>
                </TableRow>
              )}
            </TableBody>
          </Table>
        </CardContent>
      </Card>
    </div>
  );
};

export default Monitoring;
